import React from 'react'
import styled from "styled-components";
function App() {
  return <Wrapper>wow</Wrapper>;
}

const Wrapper = styled.div`
  height: 100vh;
  width: 100vw;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`;

export default App;
